import Foundation
@testable import MIME
import Testing

struct PartTests {
    @Test func headers() {
        #expect(
            Part.html.headers == [
                "Content-Disposition": "inline",
                "Content-Transfer-Encoding": "quoted-printable",
                "Content-Type": "text/html; charset=\"UTF-8\""
            ])
        #expect(
            Part.jpeg.headers == [
                "Content-Disposition": "inline; filename=\"mime-part.jpg\"; modification-date=\"Mon, 31 Oct 1977 15:14:00 +0000\"",
                "Content-Transfer-Encoding": "base64",
                "Content-Type": "image/jpeg"
            ])
        #expect(
            Part.png.headers == [
                "Content-Disposition": "attachment; filename=\"mime-part.png\"",
                "Content-Transfer-Encoding": "base64",
                "Content-Type": "image/png"
            ])
        #expect(
            Part.text.headers == [
                "Content-Disposition": "inline",
                "Content-Transfer-Encoding": "7bit",
                "Content-Type": "text/plain; charset=\"US-ASCII\""
            ])
        #expect(
            Part.zip.headers == [
                "Content-Disposition": "attachment; filename=\"mime-part.zip\"; creation-date=\"Thu, 01 Jan 1970 00:00:00 +0000\"; modification-date=\"Mon, 31 Oct 1977 15:14:00 +0000\"",
                "Content-Transfer-Encoding": "base64",
                "Content-Type": "application/zip"
            ])
    }

    @Test func parts() throws {
        let boundary: Boundary = try Boundary("boundary_test")
        let part: Part = try Part(
            parts: [
                try Part(plainText),
                try Part(quotedPrintableHTML)
            ], contentType: .multipart(.alternative, boundary))
        let parts: [Part] = try part.parts
        #expect(parts.count == 2)
        #expect(parts.first?.contentType == .text(.plain, .ascii))
        #expect(parts.first?.contentTransferEncoding == .ascii)
        #expect(parts.first?.data.count == 73)
        #expect(parts.last?.contentType == .text(.html, .utf8))
        #expect(parts.last?.contentTransferEncoding == .quotedPrintable)
        #expect(parts.last?.data.count == 384)
    }

    @Test func descriptionInit() throws {
        let html: Part = try Part(quotedPrintableHTML)
        #expect(html.contentDisposition == .inline)
        #expect(html.contentTransferEncoding == .quotedPrintable)
        #expect(html.contentType == .text("html", .utf8))
        #expect(html.data + "\n".data(using: .ascii)! == .html)
        let jpeg: Part = try Part(base64EncodedJPEGImage)
        #expect(jpeg.contentDisposition == .inline(.jpeg))
        #expect(jpeg.contentTransferEncoding == .base64)
        #expect(jpeg.contentType == .image("jpeg"))
        #expect(jpeg.data == .jpeg.base64EncodedData())
        let png: Part = try Part(base64EncodedPNGImage)
        #expect(png.contentDisposition == .attachment(.png))
        #expect(png.contentTransferEncoding == .base64)
        #expect(png.contentType == .image("png"))
        #expect(png.data == .png.base64EncodedData())
        let text: Part = try Part(plainText)
        #expect(text.contentDisposition == .inline)
        #expect(text.contentTransferEncoding == .ascii)
        #expect(text.contentType == .text("plain", .ascii))
        #expect(text.data + "\n".data(using: .ascii)! == .text)
        let zip: Part = try Part(base64EncodedArchive)
        #expect(zip.contentDisposition == .attachment(.zip))
        #expect(zip.contentTransferEncoding == .base64)
        #expect(zip.contentType == .application("zip"))
        #expect(zip.data == .zip.base64EncodedData())
    }
}

private extension Part {
    static var html: Self {
        Self(data: .html, contentDisposition: .inline, contentTransferEncoding: .quotedPrintable, contentType: .text("html", .utf8))
    }

    static var jpeg: Self {
        Self(data: .jpeg.base64EncodedData(), contentDisposition: .inline(.jpeg), contentTransferEncoding: .base64, contentType: .image("jpeg"))
    }

    static var png: Self {
        Self(data: .png.base64EncodedData(), contentDisposition: .attachment(.png), contentTransferEncoding: .base64, contentType: .image("png"))
    }

    static var text: Self {
        Self(data: .text, contentDisposition: .inline, contentTransferEncoding: .ascii, contentType: .text("plain", .ascii))
    }

    static var zip: Self {
        Self(data: .zip.base64EncodedData(), contentDisposition: .attachment(.zip), contentTransferEncoding: .base64, contentType: .application("zip"))
    }
}

private extension ContentDisposition.File {
    static var jpeg: Self { Self(filename: "mime-part.jpg", modificationDate: Date(timeIntervalSince1970: 247158840.0)) }
    static var png: Self { Self(filename: "mime-part.png") }
    static var zip: Self {
        Self(filename: "mime-part.zip", creationDate: Date(timeIntervalSince1970: 0.0), modificationDate: Date(timeIntervalSince1970: 247158840.0))
    }
}

private extension Data {
    static var html: Self { try! Bundle.module.data(forResource: "mime-part.html") }  // Quoted-printable
    static var jpeg: Self { try! Bundle.module.data(forResource: "mime-part.jpg") }
    static var png: Self { try! Bundle.module.data(forResource: "mime-part.png") }
    static var text: Self { try! Bundle.module.data(forResource: "mime-part.txt") }  // ASCII
    static var zip: Self { try! Bundle.module.data(forResource: "mime-part.zip") }
}

